// Supports 1-5 cars, optional theme animation, proper chroma_key naming

const config = $json;

const platformTexts = {
  'tiktok': 'Ask for SHAD and mention you saw this on TIKTOK!',
  'youtube': 'Ask for SHAD and mention you saw this on YOUTUBE!',
  'instagram': 'Ask for SHAD and mention you saw this on INSTAGRAM!',
  'facebook': 'Ask for SHAD and mention you saw this on FACEBOOK!',
  'none': 'Ask for SHAD for a great deal!'
};

const platform = $json.platform || 'none';
const platformText = platformTexts[platform];

const avatarUrl = $input.first().json.outputs.avatar_video_url || config.avatar_video_url;
const avatarDuration = $input.first().json.outputs.avatar_duration || config.duration || 12;
const vehicles = $input.first().json.vehicles || config.vehicles || [];
const musicUrl = config.media?.music_url || "https://res.cloudinary.com/dtpqxuwby/video/upload/v1760406868/uWu_Victory_-_Rod_Kim_dxpl7z.mp3";
const chromakeyColor = config.chromakey_color || "#89be5a";
const chromakeySensitivity = config.chromakey_sensitivity || 22;

// Theme animation (optional)
const hasTheme = config.theme && config.theme.trim() !== '' && config.theme !== 'none';
const includeAnimation = $input.first().json.include_animation || false;
const themeAnimationUrl = config.theme_animation_url || null;

if (!avatarUrl) throw new Error('Missing avatar video URL');
if (vehicles.length === 0) throw new Error('No vehicles in config');
if (vehicles.length > 5) throw new Error('Maximum 5 vehicles allowed');

console.log(`Building Creatomate TEMP_001 for ${vehicles.length} vehicles`);
console.log(`Has theme: ${hasTheme}`);
console.log(`Include animation: ${includeAnimation}`);
console.log(`Animation URL: ${themeAnimationUrl}`);
console.log(`Avatar duration: ${avatarDuration}s`);

// Animation only shows if ALL conditions met
const showAnimation = false;
  //hasTheme && includeAnimation && themeAnimationUrl !== null;
const TIME_OFFSET = showAnimation ? 2.25 : 0;

console.log(`Show animation: ${showAnimation}`);
console.log(`Time offset: ${TIME_OFFSET}s`);

// Get hook duration from audio sections
const hookSection = config._section_timings?.find(t => t.section_name === 'hook');
const hookDuration = hookSection ? hookSection.duration : 5;

// Contact-Info-intro spans hook + any animation time
const contactInfoIntroDuration = hookDuration;

console.log(`Hook duration: ${hookDuration}s`);
console.log(`Contact-Info-intro duration: ${contactInfoIntroDuration}s`);

// Calculate contact info outro timing
const lastCar = vehicles[vehicles.length - 1];
const lastCarEndTime = lastCar.end_time || (lastCar.start_time + 7);
const contactOutroStart = lastCarEndTime + TIME_OFFSET;

// Calculate platform text duration 0 to outro start
const platformTextDuration = contactOutroStart;

console.log(`Contact outro starts at: ${contactOutroStart}s`);

// Build base modifications
const modifications = {
  // Platform text
  "platform-text.text": platformText,
  "platform-text.animations[0].duration": platformTextDuration,
  "background-music.source": musicUrl,
  "Avatar-video.source": avatarUrl,
  "Avatar-video.time": TIME_OFFSET,  // Start at 0 or 2.25s
  "Avatar-video.chroma_key_color": chromakeyColor,  // underscore!
  "Avatar-video.chroma_key_sensitivity": chromakeySensitivity,  // underscore!
  "Contact-Info-intro.time": TIME_OFFSET,
  "Contact-Info-intro.duration": contactInfoIntroDuration,
  "Contact-Info-outro.time": contactOutroStart,
  "duration": avatarDuration + TIME_OFFSET,

  // Theme animation - only visible if user wants it
  "theme-animation.visible": showAnimation,
  "theme-animation.source": themeAnimationUrl || "",
  //"theme-text.visible": showAnimation,
  //"theme-text.text": config.theme || ""
};

console.log(`Theme animation visible: ${showAnimation}`);

// Add car modifications
vehicles.forEach((vehicle, index) => {
  const carNum = index + 1;
  const duration = (vehicle.end_time || 0) - (vehicle.start_time || 0);

  let priceText = vehicle.price;
  if (typeof priceText === 'string' && priceText.includes('USD')) {
    priceText = priceText.replace(' USD', '').replace('USD', '');
    const priceNum = parseFloat(priceText);
    if (!isNaN(priceNum)) {
      priceText = '$' + priceNum.toLocaleString('en-US', {maximumFractionDigits: 0});
    }
  } else if (typeof priceText === 'number') {
    priceText = '$' + priceText.toLocaleString('en-US', {maximumFractionDigits: 0});
  }

  // Format mileage with comma
  const mileageText = Number(vehicle.mileage || 0).toLocaleString('en-US') + ' mi';

  const title = `${vehicle.year} ${vehicle.make} ${vehicle.model}`;

  modifications[`Car${carNum}.time`] = vehicle.start_time + TIME_OFFSET;
  modifications[`Car${carNum}.duration`] = duration;
  modifications[`car-${carNum}.source`] = vehicle.photo_url;
  modifications[`car-${carNum}-price.text`] = priceText;
  modifications[`car-${carNum}-title.text`] = title;
  modifications[`car-${carNum}-mileage.text`] = mileageText;

  console.log(`Car ${carNum}: ${title} at ${vehicle.start_time + TIME_OFFSET}s for ${duration}s`);
});

// Hide unused car slots (template now supports 5 cars!)
const maxCars = 5;
for (let i = vehicles.length + 1; i <= maxCars; i++) {
  console.log(`Hiding unused car slot ${i}`);
  modifications[`Car${i}.visible`] = false;
}

const creatomateJson = {
  "template_id": "fa1c8b96-9d5d-4c93-9260-a2eb959220c5",
  "modifications": modifications
};

console.log('‚úÖ Final Creatomate JSON:', JSON.stringify(creatomateJson, null, 2));

return [{
  json: {
    ...config,
    creatomate: creatomateJson
  }
}];

return (async () => {

const config = $json;

const platformTexts = {
  'tiktok': 'Ask for SHAD and mention you saw this on TIKTOK!',
  'youtube': 'Ask for SHAD and mention you saw this on YOUTUBE!',
  'instagram': 'Ask for SHAD and mention you saw this on INSTAGRAM!',
  'facebook': 'Ask for SHAD and mention you saw this on FACEBOOK!',
  'none': 'Ask for SHAD for a great deal!'
};

const platform = $json.platform || 'none';
const platformText = platformTexts[platform];

// Extract data from correct locations
const avatarUrl = config.outputs?.avatar_video_url || config.avatar_video_url;
const avatarDuration = config.outputs?.avatar_duration || config.avatar_duration || config.duration || 35;
const chromaKeyColor = $input.first().json.chromakey_color || "#89be5a";
const chromaKeySensitivity = $input.first().json.chromakey_sensitivity || "20%";

// Get vehicle data from vehicles array
const vehicle = config.vehicles?.[0];
if (!vehicle) {
  throw new Error('No vehicle data found in config.vehicles');
}

const heroCarUrl = vehicle.photo_url; // This is the background-removed hero image
const selected_photos = config.selected_photos || [];
const featurePhotos = selected_photos.slice(1, 6); // exclude hero

// ========================================
// PRE-FETCH ProMax IMAGES (warm up the server)
// ========================================
console.log('üî• Pre-fetching ProMax images to warm up server...');

const preFetchUrls = [
  heroCarUrl,  // Hero car photo
  ...featurePhotos.map(p => p.photo_url)  // All featured photos
].filter(url => url && url.startsWith('http'));  // Only valid URLs

try {
  await Promise.all(
    preFetchUrls.map(async (url) => {
      try {
        const response = await fetch(url, { method: 'HEAD' });  // HEAD request is faster
        console.log(`‚úÖ Pre-fetched: ${url.substring(0, 60)}...`);
        return response;
      } catch (err) {
        console.log(`‚ö†Ô∏è Failed to pre-fetch: ${url} - ${err.message}`);
        // Don't fail the whole process, just log it
      }
    })
  );
  console.log('‚úÖ All images pre-fetched!');
} catch (err) {
  console.log(`‚ö†Ô∏è Pre-fetch error (continuing anyway): ${err.message}`);
}

// Small delay to let ProMax server settle
await new Promise(resolve => setTimeout(resolve, 1000));

console.log('üé¨ Images warmed up, continuing with Creatomate setup...');

if (!avatarUrl) throw new Error('Missing avatar video URL');
if (!heroCarUrl) throw new Error('Missing hero car image URL (vehicle.photo_url)');
if (featurePhotos.length < 3 || featurePhotos.length > 5) {
  throw new Error(`Need 3-5 feature photos, got ${featurePhotos.length}`);
}

// Get section timings from audio generation
const sectionTimings = config._section_timings || [];
const hookSection = sectionTimings.find(t => t.section_name === 'hook');

const hookDuration = hookSection?.duration || 4;
// sum of hook and hero speaking segments after which avatar and hero scale down
const heroPlusHookDuration = hookDuration + sectionTimings[1].duration;

// Outro timing (starts when feature 5 ends)
const contactOutroStart = sectionTimings[6].end_time;
const platformTextDuration = avatarDuration;

console.log(`üìç Contact outro starts at: ${contactOutroStart}s`);

// Format price - handle both vehicle.price and root level Price/internetPrice
let priceText = vehicle.price || config.Price || config.internetPrice || '0';
if (typeof priceText === 'string' && priceText.includes('USD')) {
  priceText = priceText.replace(' USD', '').replace('USD', '');
}
const priceNum = parseFloat(priceText);
if (!isNaN(priceNum)) {
  priceText = '$' + priceNum.toLocaleString('en-US', {maximumFractionDigits: 0});
}

// Generate wiggle animations every 3 seconds
const priceWiggles = [];
for (let t = 3; t < avatarDuration; t += 3) {
  priceWiggles.push({
    "time": t,
    "duration": 0.5,
    "easing": "linear",
    "type": "wiggle"
  });
}

// Format vehicle title from vehicle object
const vehicleTitle = `${vehicle.year} ${vehicle.make} ${vehicle.model}`;

// Build base modifications
const modifications = {

  // Platform text
  "platform-text.text": platformText,
  "platform-text.duration": platformTextDuration,
  "platform-text.animations":[
    {
      "time": 0,
      "duration": platformTextDuration,
      "easing": "linear",
      "type": "shift",
      "direction": "left",
      "repetitions": "3"
    }
  ],

  // Hero car title and price mods
  "hero-car.source": heroCarUrl,
  "hero-car.animations": [
    {
      "time": heroPlusHookDuration,
      "duration": 1,
      "type": "scale",
      "fade": false,
      "scope": "element",
      "x_anchor": "79%",
      "y_anchor": "6%",
      "end_scale": "70%",
      "start_scale": "100%"
    }
  ],
  "hero-car-title.text": vehicleTitle,
  "hero-car-price.text": priceText,
  "hero-car-price.animations": priceWiggles,

  // Contact info outro (starts with CTA)
  "Contact-Info-outro.time": contactOutroStart,

  // Total duration
  "duration": avatarDuration,

  // Avatar mods
  "Avatar-video.source": avatarUrl,
  "Avatar-video.chroma_key_color": chromaKeyColor,
  "Avatar-video.chroma_key_sensitivity": chromaKeySensitivity,
  "Avatar-video.animations": [
    {
      "time": heroPlusHookDuration,
      "duration": 1.5,
      "type": "scale",
      "fade": false,
      "scope": "element",
      "x_anchor": "12%",
      "y_anchor": "100%",
      "end_scale": "70%",
      "start_scale": "100%"
    }
  ]
};

// Add feature photos with timing (only for photos that exist)
featurePhotos.forEach((photo, index) => {
  const photoNum = index + 1; // featured-1 through featured-5
  const timingSeg = sectionTimings[photoNum + 1]; // timing array includes hook at 0

  if (photo && photo.photo_url && timingSeg) {
    modifications[`featured-${photoNum}-photo.source`] = photo.photo_url;
    modifications[`featured-${photoNum}-photo.time`] = timingSeg.start_time;
    modifications[`featured-${photoNum}-photo.duration`] = timingSeg.duration;
  }
});

// Hide unused feature photo slots (if we have less than 5)
for (let i = featurePhotos.length + 1; i <= 5; i++) {
  modifications[`featured-${i}-photo.visible`] = false;
}

const creatomateJson = {
  "template_id": "e20c9d7e-8f64-4c28-ac0f-bad1847276c4",
  "modifications": modifications
};

console.log('‚úÖ Template 2 Creatomate JSON built');
console.log(`üé¨ Hero car & avatar scale down at: ${hookDuration}s`);
console.log(JSON.stringify(creatomateJson, null, 2));

return [{
  json: {
    ...config,
    creatomate: creatomateJson
  }
}];

})();
